#include "hash.h"

namespace ZeroLogic::Perft::TT{

    struct entry{
        Hash hash{0};
        u32 nodecount{};
        Depth d{};
    };

    entry* table;

    void init(u32 size = key_mask){
        table = (entry*) calloc(size, sizeof(entry));
        for (u32 s = 0; s <= size; s++)
            table[s].d = 0x7f;
        key_mask = size;
    }
    void clear(){
        free(table);
    }

}

namespace ZeroLogic::Search::TT {

    // move encoding:
    // 111111  (6) - to
    // 1111    (4) - flags
    // 111111  (6) - from

    struct entry{
        Hash hash{0};
        Move move{};
        Depth d{};
    };
    entry* table;

    void init(u32 size = key_mask){
        table = (entry*) calloc(size, sizeof(entry));
        key_mask = size;
    }
    void clear(){
        free(table);
    }

    inline void replace(entry entry){
        if (entry.d >= table[*entry.hash].d && entry.move)
            table[*entry.hash] = entry;
    }

}

